import React, { Component } from "react";

class TableData extends Component {
  render() {
    return (
      <div>
        <table className="ui celled table">
          <thead className>
            <tr className>
              <th className>STT</th>
              <th className>Name</th>
              <th className>Phone</th>
              <th className>Right</th>
              <th className>Acction</th>
            </tr>
          </thead>
          <tbody className>
            <tr className>
              <td className>Cell</td>
              <td className>Cell</td>
              <td className>Cell</td>
              <td className>Cell</td>
              <td className="Acction"><button  className="ui red button">Delect</button><button className="ui blue button">Edit</button></td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default TableData;
